  { name: "Emily Carter", topic: "Cloud Computing Trends 2025" },
  { name: "Rahul Verma", topic: "Mastering Frontend with React" },
  { name: "Isabella Thompson", topic: "Cybersecurity & Ethical Hacking" }
];

const SpeakerSchedule = () => {
  return (
    <div className="speaker-schedule-container">
